import React from 'react';
import image from '/public/badminton-logo.png';

import './Header.css';

const Header = props => {
  return (
    <header className="header">
      <h1>MERN Shop</h1>
        <img src={image} height={100} width={100} />
    </header>
  );
};

export default Header;
